css:
@-moz-document domain("www.youtube.com")
{



.html5-play-progress, .ytp-play-progress {
   background: url("https://i.imgur.com/jsTL6Fe.gif") repeat-x !important; 
background: url("https://i.imgur.com/07sC987.png") !important;
}


.html5-load-progress, .ytp-load-progress {
   background:  url("https://i.imgur.com/PmfhnHc.gif") !important;
}




.html5-scrubber-button, .ytp-scrubber-button {
   background: url("https://i.imgur.com/wiTFnAb.gif") !important;
   width: 79px !important;
   height: 54px !important;
   border: none !important;
   margin-left: -60px !important;
   margin-top: -20px !important;
   transform: scale(0.8);
-webkit-transform: scale(0.8);
-moz-transform: scale(0.8);
-ms-transform: scale(0.8);
}




.html5-progress-bar-container, .ytp-progress-bar-container {
   height: 12px !important;
}
.html5-progress-bar, .ytp-progress-bar {
   margin-top: 12px !important;
}

}
